import ModuleType from "jx/core/presets/StageGameModule";
import Screen00 from "src/screens/Screen00"

export default class MainCtrl extends ModuleType {
	constructor(dataObject){
		super(Object.assign({
			stageWidth: 1280,
			ratio: 16/9,
			screen: "intro",
			helper: false, 
			blockMobileScroll: false, 
			blockMobileContextualMenu: false, 
			delayAfterClick: false, 
			flashQuality: "good",
			commonFlaLib: false
		}, dataObject));
	}


	_onBeforeLoad(callback) {
		callback();
	}


	/*******************************************************************************
	* INIT
	*/
	init(onInitialised){

		this._configure(this.dataObject);

		this.ccid({id: "screens", type: "ScreensManager", stage: this.stage, defaultTransition: "FadeBlackInOut"});

		this.screens.add({id: "intro", type: "ScreenVideo", rid: "INTRO", bgMusicVolPC: 0, stage: this.stage, 
			onfinished: evt=>{
				this.jx.dj.music.play({id:"MUSIC"});
				this.screens.go("screen00");
			}
		});

		this.screens.add({id: "screen00", type: Screen00, stage: this.stage, 
			onfinished: evt=>{
			}
		});

		this.comps.initChildren(onInitialised);
	}

	/*******************************************************************************
	* START
	*/
	start(){

		this.screens.go(this.firstScreen);
		// this.jx.dj.music.play({id:"MUSIC"});
	}


	_configure({
			helper=false, 
			blockMobileScroll=false, 
			blockMobileContextualMenu=false, 
			delayAfterClick=false, 
			flashQuality="good",
			commonFlaLib=false,
			screen="intro"
		}) {

		if (helper) this.jx.helper = this.cc({type: Helper, stage: this.stage});

		if (blockMobileContextualMenu) $("body").css("-webkit-touch-callout", "none");

		if (blockMobileScroll) {
			document.ontouchmove = function (e) {
			  e.preventDefault();
			}
		}

		if (delayAfterClick) this.jx.config.app.lockDelayAfterClick = 250;

		this.jx.config.flashOptimizer.quality = flashQuality;

		this.stage.ratio = this.dataObject.ratio;

		if (commonFlaLib) this.commonLib = this.jx.db.findOne({id: "COMMON_LIB.SCREEN"}).data;

		this._getFirstScreenAndPhase({firstScreen: screen});
	}


	/**
	 * get the first screen and phase
	 */
	_getFirstScreenAndPhase({firstScreen}) {
		let screenShortcut = (this.jx.config.urlParams.screen || firstScreen).split("."); // priority to screen passed as argument in url (&screen="screenID");
		this.firstScreen = screenShortcut[0];
		this.firstPhase = screenShortcut.length > 1 ? screenShortcut[1] : null;
	}


}

import ScreenFlashBase from "src/screens/ScreenFlashBase"

/**
 */
export default class Screen00 extends ScreenFlashBase{

	constructor(dataObject) {
		super(Object.assign({screenName: "SCREEN_00"}, dataObject));
	}


	init(callback) {
		super.init(()=>{
			callback();
		});
	}


	_initScreen() {
		super._initScreen();
	}


	show(callback, data) {
		super.show(()=>{
			callback({target: this});
		}, data);
	}


	kill() {
		if (this._killed) return;
		super.kill();
	}

}

import Component from "jx/core/comps/Component"


/**
* **Events:**
* - onfinished : fired when screen is completed.
 */
export default class ScreenBase extends Component{

	constructor(dataObject) {
		super(Object.assign({
			stage: null,
			screenManager: null,
			screenName: null
		}, dataObject));


		/** @type {StageView} */
		this.stage = this.dataObject.stage || this.jx.app.stage;
		/** @type {ScreenManager} */
		this.screenManager = this.dataObject.screenManager || this.jx.app.screens;
		/** @type {String} */
		this._screenName = this.dataObject.screenName;

		this.notInit = true;

		this.addEventDispatcher("onfinished");
		if (this.dataObject.onfinished) this.onfinished.add(this.dataObject.onfinished);

		this._config = {
		};

		//-- get screen config in json
		let jsonConfig = this.jx.db.getParameter(this._screenName + ".Configuration");
		if (jsonConfig)  Object.assign(this._config, jsonConfig);

		this._declareProperties();
	}


	_declareProperties() {
	}


	kill() {
		if (this._killed) return;

		if (this.screen) {
			this.hide();
			this.screen = null;
		};

		this.onfinished.removeAll();
		this.stage = null;
		this.onfinished = null;
		this.screenManager = null;
		super.kill();
	}


	/**
	 * init (async) screen (clipcjs)
	 * @param  {Function} callback 
	 */
	init(callback) { 
		this.comps.initChildren( ()=>{
				this._initScreen(); 
				callback();
		});
	}


	/**
	 * initScreen after this._lib (ClipCJS) is ready.
	 */
	_initScreen() {

	}


	/**
	 * show screen
	 * @param  {Function} callback fired when screen is really displayed.
	 * @param  {any}   data     data to transmit to screen
	 */
	show(callback, data) {
		callback({target: this});
	}


	/**
	 * hide screen
	 */
	hide() {
	}

}

import ScreenBase from "src/screens/ScreenBase"


/**
* **Events:**
* - onfinished : fired when screen is completed.
 */
export default class ScreenFlashBase extends ScreenBase{

	constructor(dataObject) {
		super(Object.assign({
			stage: null,
			screenManager: null,
			screenName: null
		}, dataObject));

		this._config.rid = this._screenName + ".FLASHSCREEN.CONFIG";
	}


	kill() {
		if (this._killed) return;

		if (this.screen) {
			this.hide();
			this.screen = null;
		}
		this._lib = null;
		window[this._screenName] = null;
		window[this._screenName + "_images"] = null;

		super.kill();
	}


	/**
	 * init (async) screen (clipcjs)
	 * @param  {Function} callback 
	 */
	init(callback) { 
		this.jx.db.load({id: this._screenName + ".FLASHSCREEN.SCREEN"}, ()=>{
			this._lib = this.cc({rid: this._config.rid, stage: this.stage, exclude: [], 
				toFreeze: [], visible: false});
			super.init(callback);
		});
	}


	/**
	 * initScreen after this._lib (ClipCJS) is ready.
	 */
	_initScreen() {
		this.ccid({id: "screen", type:"Clip", view: this._lib.getMC("SCREEN")});
	}


	/**
	 * show screen
	 * @param  {Function} callback fired when screen is really displayed.
	 * @param  {any}   data     data to transmit to screen
	 */
	show(callback, data) {
		super.show(()=>{
			this.stage.addChild(this._lib);
			this._lib.visible = true;
			this._lib.unfreeze();

			callback({target: this});
		});
	}


	/**
	 * hide screen
	 */
	hide() {
		super.hide();
		this._lib.visible = false;
		this._lib.freeze();
		this.stage.removeChild(this._lib);
	}

}
